import React, { useState } from 'react';

export const CreateAccountcomponent = ({ 
    firstName,
    setFirstName,
    lastName,
    setLastName,
    firstNamePlaceholder,
    lastNamePlaceholder,
    handleFirstNameClick,
    handleLastNameClick,
    handleFirstNameBlur,
    handleLastNameBlur
}) => {

    return (
        <form>

            <h1 class="thin space">Create a Google Account</h1>

            <h2 class='thin gap'>Enter your name</h2>

            <label class="space line-height label-input-width input-label">
                <input 
                    class="input"
                    type='text' 
                    value={firstName} 
                    onChange={(e) => setFirstName(e.target.value)} 
                    placeholder={firstNamePlaceholder}
                    onFocus={handleFirstNameClick}
                    onBlur={handleFirstNameBlur}
                />
            </label>
     
            <label class="space line-height label-input-width input-label">
                <input 
                    class="input disable-eye-icon"
                    type='text'
                    value={lastName}
                    onChange={(e) => setLastName(e.target.value)}
                    placeholder={lastNamePlaceholder}
                    onFocus={handleLastNameClick}
                    onBlur={handleLastNameBlur}
                />
            </label>
            
            <section class=''>
                <button class="space blue-button">
                    Next   
                </button>
            </section>

        </form>
    );
}
